import Card from '../Components/Card'
const Prodoucts = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    getProducts();
  }, []);
  const getProducts = async () => {
    try {
      const res = await axios.get("http://127.0.0.1:1214/api/products/users");
      setData(res.data.users);
    } catch (e) {
      console.log(e.response.data.Message);
    }
  };
  return (
    <>
     <div className="container">
          <div className="row">
            {
              data.map(x=>{
                return(
                  <>
                  <div className="col-lg-3 mt-5 col-md-6 col-sm-12"></div>
                    
                  </>
                )
              })
            }
          </div>
        </div>
    </>
  );
};

export default Prodoucts;
